    class _JIT(object):
        def _copy_func_and_apply_params(self, f, params):
            import copy
            import types
            import functools

            """Based on https://stackoverflow.com/a/13503277/2988730 (@unutbu)"""
            globals = f.__globals__.copy()
            for k in params:
                globals[k] = params[k]
            g = types.FunctionType(f.__code__, globals, name=f.__name__,
                                   argdefs=f.__defaults__, closure=f.__closure__)
            g = functools.update_wrapper(g, f)
            g.__module__ = f.__module__
            g.__kwdefaults__ = copy.copy(f.__kwdefaults__)
            return g

        def func(self, sig, params):
            def dec(func):
                from numba import jit
                gfunc=self._copy_func_and_apply_params(func, params)
                ff = jit(sig)(gfunc)
                return ff
            return dec

        def scalar(self, sdim=3, td=False, params={}):
            def dec(func):
                l = len(signature(func).parameters)
                if l == 1 and not td:
                    sig = types.double(types.CPointer(types.double))
                    use_0 = 1
                elif l == 2 and not td:
                    sig = scalar_sig
                    use_0 = 0			  
                elif l == 2 and td:
                    sig = types.double(types.CPointer(types.double),
                    types.double)
                    use_0 = 1			  			  
                elif l == 3 and td:
                    sig = scalar_sig_t
                    use_0 = 0			  			  			  
                from numba import cfunc
                gfunc=self._copy_func_and_apply_params(func, params)
                ff = cfunc(sig)(gfunc)
                coeff = NumbaFunction(ff, sdim, td).GenerateCoefficient(use_0)
                return coeff
